import Collapsible from "../../Collapsible";

const ListPage = () => {

    return (
        <div className="main-page">
            <hr /> <hr />
            <Collapsible label="Chest Pain">
                <h2>Chest Pain</h2>
                <p id="overview">Any part of your chest can hurt when you have chest pain. The pain may spread to other parts of your body, including your arms or neck.</p>
            </Collapsible>
            <hr />
            <Collapsible label="Hemoptysis" />
            <hr />
            <Collapsible label="Headache" />
        </div>
    );
}

export default ListPage;
